// Header.js
import React, { useState } from 'react';
import './Header.css';
import logo from '../../assets/logo.jpeg';
import Button from '@material-ui/core/Button';
import AuthenticationModal from '../../screens/authentication/AuthenticationModal';

const Header = () => {
    const [isLoginModalOpen, setLoginModalOpen] = useState(false);

    const handleLoginModalOpen = () => {
        setLoginModalOpen(true);
    };

    const handleLoginModalClose = () => {
        setLoginModalOpen(false);
    };

    return (
        <div className="header">
            <div className="logo-container">
                <img src={logo} alt="Logo" className="logo" />
                <h3>Doctor Finder</h3>
            </div>
            <div className="button-container">
                <Button variant="contained" color="primary" onClick={handleLoginModalOpen}>Login</Button>
                <Button variant="contained" color="secondary">Logout</Button>
            </div>
            <AuthenticationModal isOpen={isLoginModalOpen} handleClose={handleLoginModalClose} />
            <div className="home-container">
            <Tabs value={activeTab} onChange={handleTabChange}>
                <Tab label="DOCTORS" />
                <Tab label="APPOINTMENT" />
            </Tabs>
            <div className="tab-content">
                {activeTab === 0 && (
                    <div className="doctors-tab-content">
                        {/* Content for Doctors tab */}
                        <h2>DOCTORS</h2>
                        {/* Add your doctor list, filters, and buttons here */}
                    </div>
                )}
                {activeTab === 1 && (
                    <div className="appointment-tab-content">
                        {/* Content for Appointment tab */}
                        <h2>APPOINTMENT</h2>
                        {/* Add your appointment list here */}
                    </div>
                )}
            </div>
        </div>
        </div>
    );
}

export default Header;
